import logo from './logo.svg';
import './App.css';
import React, {useEffect, useState} from "react";
import axios from "axios";

function App() {
    const [hello = { userId : ''}, setHello] = useState([])

    useEffect(() => {
      axios.get('/api/user/getUserList')
          .then(response => setHello([...hello, response.data]))
          .catch(error => console.log(error))
    }, []);

    return (
        <div>
          백엔드에서 가져온 데이터입니다 : {hello[0].userId}
        </div>
    );
}

export default App;
